    [],nt"num_tags": 4,nt"name": "moosehorn-national-wildlife-refuge-january-april-1957-narrative-report",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Moosehorn NWR
    (including the Edmunds Unit) outlines Refuge accomplishments from January through
    April of 1957. The report begins by summarizing the weather conditions and water
    conditions during this period. Wildlife- including migratory birds, upland game
    birds, big game animals, furbearers, predators, rodents, mammals, raptors, and fish-
    is also covered. The Refuge development and maintenance section discusses physical
    developments and plantings. Resource management is outlined; topics include fur
    harvesting and timber removal. A progress report on field investigations and applied
    research is also provided. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, fishing, and violations.
    Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
